import React, { Component } from "react";

class Table extends Component {
  render() {
    const TableHeader = () => {
        return (
          <thead>
            <tr>
              <th>Name</th>
              <th>Job</th>
            </tr>
          </thead>
        )
      }
    return (
      <table>
        <thead>
          <tr>
            <th>Student Names:</th>
          </tr>
        </thead>
        <tbody>
          <tr>
            <td>Student Name</td>
          </tr>
        </tbody>
      </table>
    );
  }
}

export default Table;
